  false,\n\t\"url\": null,\n\t\"notes\": \"The layer is meant to display those locations
  offshore where bedrock is present, as these locations may support sensitive habitats
  that could be adversely affected by sediment management activities. These data are
  intended for science researchers, students, policy makers, and the general public.
  The data can be used with GIS or other software to display the seafloor substrate
  types of the Nearshore Coastal Zone of the San Diego Region.This layer was provided
  to CSMW by Moffatt Nichol as part of their efforts related to the San Diego Coastal
  RSM Plan. The original data was reportedly compiled by SANDAG as part of the 'San
  Diego nearshore program.' Symbology is displayed according to 'descrip' attribute,
  and entries indicated 'bedrock' and 'cobble'. Numerous entries were left blank,
  and so the decriptor 'other' is used for those polygons.\",\n\t\"license_title\":
